import styles from "./../assets/components/Navigation.module.css";
import wiseLogo from "./../assets/img/wise-logo.png";

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import DashBoard from "../pages/DashBoard";
// import Guide from "./../pages/Guide";

function Navigation(){
    return (
        <Router>
            <div className={styles.containerNavigation}>
                <div className={styles.containerHeader}>
                    <p>Ambiente de Gest√£o</p>
                    <img src={wiseLogo} alt="logo da Wise"/>
                </div>
                {/* <Route exact path="/" component={DashBoard} />
                <Route path="/guide" component={Guide} /> */}
                <div className={styles.containerPages}>
                    <div >DASHBOARD</div>
                    <div>GUIA E PROCEDIMENTOS</div>
                    <div>CHURNING DE CLIENTES</div>
                    <div>MAPAS</div>
                    <div>SIMILARIDADE DE IMAGENS</div>
                </div>
                <div className={styles.logout}>
                    wise
                </div>
                <Switch>
                    <Route exact path="/" componet={DashBoard}/>
                </Switch>
            </div>
        </Router>
    );
}

export default Navigation;
